import org.apache.spark.ml.feature.{OneHotEncoder, StringIndexer}
import org.apache.spark.ml.{Pipeline, PipelineModel}
//Puis suite à nos besoins on recupère aussi VectorAssembler
import org.apache.spark.ml.feature.{VectorAssembler}


// On construit le OneHotEncoder et le StringIndexer pour toute les variables données
def prepadata(w: String) = 
{


// On ajoute au nom de colonne "Index"
val stringIndexer = new StringIndexer()
    .setInputCol(w)
    .setOutputCol(w+"Index")

// On ajoute au nom de colonne "ClassVec"  
val oneHotEncoder = new OneHotEncoder()
   .setInputCol(stringIndexer.getOutputCol)
   .setOutputCol(stringIndexer.getInputCol + "ClassVec")

// On renvoit le StringIndexer et le OneHotEncoder
Seq(stringIndexer, oneHotEncoder)

}


//"Detail colomns to deal with" => on a donc les colonnes qu'on veut binariser.
